"Згадайте, де ви побували, переглянувши фотографії з інформацією про місцезнаходження, зокрема збережені знімки, якими з вами поділилися. Вашу карту створено на основі таких геоданих:

 • відомості GPS вашої камери;
 • історія місцезнаходжень Google;
 • виявлені орієнтири."

"Google Фото назавжди видалить із вашого пристрою такі дані додатка: 

• фотографії та відео в особистій папці; 
• дані про облікові записи, у які ви входили; 
• налаштування. 

Фотографії й відео за межами особистої папки та інші дані додатка залишаться."
